import Link from 'next/link';
import Search from './Search';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Search></Search>
  </div>
);

export default Header;
